    "2015-09-27T01:41:16.439900",nt"name": "bathymetric-position-index-bpi-structures-10-m-grid-derived-from-gridded-bathymetry-of-asuncion",nt"isopen":
    false,nt"url": null,nt"notes": "BPI Structures are derived from two scales
    of a focal mean analysis on bathymetry and slope. The grid is based on gridded (10
    m cell size) multibeam bathymetry collected aboard NOAA Ship Hi'ialakai and R/V
    AHI, and it was created using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
    Cell values represent one of 14 classes in an index of seafloor terrains. This data
    set is for the shelf and slope environments of Asuncion Island. As part of the northern
    islands of the Mariana Islands archipelago, Asuncion's offshore terrain has a shelf
    (above -60m) and a deep shelf (below -60m) that are both present off the southwest
    side of the island. Conversely, the southern islands each have a shelf (above -100m)
    with escarpments that lead to broad flat areas without forming a deeper shelf.",nt"license_title":
